from typing import List
class Solution:
    def maximumSum(self, nums: List[int]) -> int:
        arr = []
        for num in nums:
            div=num
            summ=0
            while div!=0:
                rest=div%10
                summ+=rest
                div//=10
            arr.append(summ)
        
        res = -1
        for i in range(len(arr)):
            for j in range(i+1,len(arr)):
                if arr[i]==arr[j]:
                    res = max(res, nums[i]+nums[j])
        return res
        

